import React, { useState } from "react";
import { Navbar, Nav } from "rsuite";
import Nmims from "../../assets/Logo.png";
import AdminIcon from "@rsuite/icons/Admin";
import HamburgerMenu from "react-hamburger-menu";
import styled from "styled-components";

const Dashboard = () => {
  const [isOpen, setIsOpen] = useState(false);

  const handleClick = () => {
    setIsOpen(!isOpen);
  };

  return (
    <Wrapper>
      <Navbar>
        <Navbar.Brand href="/Dashboard" style={{ height: "100%" }}>
          <img src={Nmims} alt="loading" />
        </Navbar.Brand>
        <Nav className={`nav-items ${isOpen ? "open" : ""}`}>
          <Nav.Item>Company Listing</Nav.Item>
          <Nav.Item>Records</Nav.Item>
          <Nav.Item>Student Data</Nav.Item>
          <Nav.Item>Student Assessments</Nav.Item>
          <Nav.Item>View Queries</Nav.Item>
          <Nav.Item>Analytics</Nav.Item>
          <Nav.Item icon={<AdminIcon />}>UserName</Nav.Item>
        </Nav>
        <Nav pullRight className="desktop-only">
          <Nav.Item icon={<AdminIcon />}>UserName</Nav.Item>
        </Nav>
        <HamburgerMenuWrapper>
          <HamburgerMenu
            isOpen={isOpen}
            menuClicked={handleClick}
            width={18}
            height={15}
            strokeWidth={2}
            rotate={0}
            color="white"
            borderRadius={0}
            animationDuration={0.5}
          />
        </HamburgerMenuWrapper>
      </Navbar>
    </Wrapper>
  );
};

export default Dashboard;

const Wrapper = styled.div`
  .rs-navbar {
    background-color: #af1111;
    color: white;
    display: flex;
    align-items: center;
    img {
      background: white;
      width: 100%;
    }
    .rs-navbar-brand {
      padding: 0;
    }
    .rs-navbar-nav:nth-last-child(2) {
      width: 90%;
      display: flex;
      align-items: center;
      justify-content: center;
      .rs-navbar-item {
        margin-right: 30px !important;
      }
    }
  }

  @media (max-width: 768px) {
    .nav-items {
      display: none;
    }
    .nav-items.open {
      display: flex;
      flex-direction: column;
      position: absolute;
      top: 60px;
      left: 0;
      right: 0;
      background-color: #af1111;
      z-index: 10;
    }
    .rs-navbar-nav:nth-last-child(2
        ) {
      width: 100%;
      flex-direction: column;
      align-items: flex-start;
      .rs-navbar-item {
        margin-right: 0 !important;
        padding: 10px;
      }
    }
    .desktop-only {
      display: none;
    }
  }

  @media (min-width: 769px) {
    .hamburger-menu {
      display: none;
    }
  }
`;

const HamburgerMenuWrapper = styled.div`
  display: none;
  @media (max-width: 768px) {
    display: block;
    margin-left: auto;
    padding: 10px;
  }
`;
